public class InnerListenerActionFactory(Action<Humidifier.ElasticLoadBalancingV2.ListenerTypes.Action> factoryAction = null) : SubResourceFactory<Humidifier.ElasticLoadBalancingV2.ListenerTypes.Action>
{

    internal InnerListenerFixedResponseConfigFactory FixedResponseConfigFactory { get; set; }

    internal InnerListenerAuthenticateCognitoConfigFactory AuthenticateCognitoConfigFactory { get; set; }

    internal InnerListenerRedirectConfigFactory RedirectConfigFactory { get; set; }

    internal InnerListenerForwardConfigFactory ForwardConfigFactory { get; set; }

    internal InnerListenerAuthenticateOidcConfigFactory AuthenticateOidcConfigFactory { get; set; }

    protected override Humidifier.ElasticLoadBalancingV2.ListenerTypes.Action Create()
    {
        var actionResult = CreateAction();
        factoryAction?.Invoke(actionResult);

        return actionResult;
    }

    private Humidifier.ElasticLoadBalancingV2.ListenerTypes.Action CreateAction()
    {
        var actionResult = new Humidifier.ElasticLoadBalancingV2.ListenerTypes.Action();

        return actionResult;
    }
    public override void CreateChildren(Humidifier.ElasticLoadBalancingV2.ListenerTypes.Action result)
    {
        base.CreateChildren(result);

        result.FixedResponseConfig ??= FixedResponseConfigFactory?.Build();
        result.AuthenticateCognitoConfig ??= AuthenticateCognitoConfigFactory?.Build();
        result.RedirectConfig ??= RedirectConfigFactory?.Build();
        result.ForwardConfig ??= ForwardConfigFactory?.Build();
        result.AuthenticateOidcConfig ??= AuthenticateOidcConfigFactory?.Build();
    }

} // End Of Class

